INSERT INTO `contribution` (`id`, `title`, `poem_content`, `author`, `date`, `typeOfPoem`) VALUES
(32, 'Světluška', 'Světluško drobounká, proč létáš samotná?\r\nV trhlině nicoty skrytá za přetvářkou,\r\nčí cestu osvětlíš, nicotná lampářko,\r\npro koho se smrtí tančit jsi ochotná?\r\nSvětluško drobounká, proč létáš samotná?\r\n\r\nSvětluško malinká, kdo jsou tví přátelé?\r\nProč leží na dlažbě s pohledem mrtvolným,\r\nočima skleslýma, úsměvem pokorným,\r\nkdyž venku pějí andělé?\r\nSvětluško malinká, kdo jsou tví přátelé?\r\n\r\nSvětluško překrásná, kdo ti to provedl?\r\nPláštík tvůj znesvětil, nožičku utrhl,\r\nkdopak tě v bolesti strašlivé uvrhl,\r\nkdopak tě v jeskyni ztemnělou uvedl?\r\nSvětluško překrásná, kdo ti to provedl?\r\n\r\nSvětluško třpytivá, na dně si libujme,\r\nzde také patříme, nic nám zde nechybí,\r\nkaždý přec jedenkrát v životě pochybí,\r\nlásku a oddanost nuzně si slibujme;\r\nSvětluško třpytivá, na dně si libujme.\r\n', 'TestSubject', '2022-09-06', 'AABB'),
(41, 'Něha ', 'Něhy se bojím a něhy se obávám,\r\njsem zhrzenou postavou modlíc se k povahám\r\ntěch, co v srdce orané sémě chtěli sít,\r\ntekutin předrahých hltavě pít\r\na něžně hnaly harfou prsty\r\na klane ach! Ty jejich prsy\r\npřál bych si v dlaních mít.\r\n\r\nNěhy se bojím a něhy se obávám,\r\na přesto ji žádám, ať nepatří k obavám\r\ntěm, co šípek amora pod kůži nosí,\r\no bydlo chudobné vtíravě prosí\r\na klane ach! Ty jejich hlasy!\r\nDoufal já že rusé vlasy\r\nskrývat se budou v nich.', 'BlackFlame', '2022-12-06', 'ABBA'),
(45, 'Krása', '\r\nS pohledem na krásu srdce se svírá,\r\nžalostná vzpomínka u mysli posedí,\r\ntak už to ve světě prokletých bývá,\r\nže smutek s láskou sousedí.\r\n\r\nOko si postekne po křivkách ženy,\r\njež chtíč pohledem živila,\r\nmysl si nezvykne na hlasu změny,\r\nbyť kolena ji lomila.\r\n\r\nRuka si postekne po kůži hladké,\r\nco dotekem les spálila,\r\nA rty si postesknou po chuti sladké;\r\nnač žádostivost zabila?\r\n\r\nJak maličko málo, jak maličko málo\r\npřeje si srdce přežíti, \r\nač při cizím pohledu vřele se smálo,\r\nvždy přálo jen si užíti.\r\n', 'KyluDokuhebi', '2022-12-06', 'AABB'),
(46, 'Jak', 'Jak šťasten jsem byl a jak šťastnen budu,\r\naž místo bolesti, strachu a studu\r\nucítím prsty tvé.\r\n\r\nJak život jsem žil a žít budu znova,\r\naž místo výčitek, slastného slova\r\nvypustí ústa tvá\r\n\r\nJak v boha jsem věřil a uvěřím zas,\r\naž místo trápení ke mně pán čas\r\npřivede kroky tvé\r\n\r\nA jak hloupý jsem byl a jak hloupý zůstanu,\r\naž místo odpustku smrti trest dostanu,\r\nza požehnání tvé\r\n \r\n', 'BlackFlamia', '2022-12-06', 'AABB');
